import Header from "./Header";
import Footer from "./Footer";
import ReactPaginate from "react-paginate";
import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";

// render products data when we search or sort products or do nothing(display all products)
const renderData = (job, navigate) => {
  return (
    <div class="row g-1 ">
      {job.map((job) => (
        <div class="col-md-3">
          <div
            class="card-deck card p-3"
            style={{ height: 480 }}
            key={job.id}
            onClick={() => {
              navigate("/product/" + product.product_id);
            }}
          >
            <div class="card-body">
              <h5 class="card-title" style={{ textAlign: "start" }}>
                {job.name}
              </h5>
            </div>
          </div>{" "}
        </div>
      ))}
    </div>
  );
};

export default function SubJobForEmployee() {
  // Invoke when user click to request another page.
  const [pageCount, setpageCount] = useState(1);
  const [currentPage, setcurrentPage] = useState(0);
  const [data, setData] = useState([]);
  const [product, setProduct] = useState([]);
  const [field, setField] = useState("");
  const [sortType, setsortType] = useState("");
  const [status, setStatus] = useState("idle");
  const isIdle = status === "idle";
  const isSort = status === "sort";
  var newArray = [];
  let { id } = useParams();
  const endPoint = `https://mlr4fsfb80.execute-api.ap-southeast-1.amazonaws.com/default/managerds/products/?currentPage=${currentPage}&subcategory_id=${id}`;
  const endPoint1 = `https://mlr4fsfb80.execute-api.ap-southeast-1.amazonaws.com/default/managerds/products/?subcategory_id=${id}&totalproducts`;
  let limit = 4;
  let navigate = useNavigate();

  return (
    <div
      className=".container-fluid"
      style={{ paddingLeft: 20, paddingRight: 10 }}
    >
      <div>
        <Header />
      </div>
      <div className="row">
        <div className="col">
          <div
            class="btn-group"
            role="group"
            aria-label="Button group with nested dropdown"
            style={{ paddingLeft: 20, height: 39 }}
          >
            <div style={{ paddingLeft: 20, width: 200 }}>
              <a
                class="nav-link dropdown-toggle"
                data-bs-toggle="dropdown"
                href="#"
                role="button"
                aria-expanded="false"
              >
                Sort By
              </a>
              <ul class="dropdown-menu">
                <li>
                  <a
                    class="dropdown-item"
                    onClick={() => fetchDataSort("price", "asc", currentPage)}
                  >
                    Price Low To High
                  </a>
                </li>
                <li>
                  <a
                    class="dropdown-item"
                    onClick={() => fetchDataSort("price", "desc", currentPage)}
                  >
                    Price High To Low
                  </a>
                </li>
                <li>
                  <a class="dropdown-item">Newest</a>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </div>

      <div style={{ paddingTop: 20 }}>
        <div style={{ paddingTop: 20 }}>
          {isIdle
            ? product?.length
              ? renderData(product, navigate)
              : null
            : null}

          {isSort
            ? product?.length
              ? renderData(product, navigate)
              : null
            : null}
        </div>
        <br />
        <ReactPaginate
          previousLabel={"< previous"}
          nextLabel={"next >"}
          breakLabel={"..."}
          pageCount={pageCount}
          marginPagesDisplayed={2}
          pageRangeDisplayed={3}
          onPageChange={handlePageClick}
          containerClassName={"pagination justify-content-center"}
          pageClassName={"page-item"}
          pageLinkClassName={"page-link"}
          previousClassName={"page-item"}
          previousLinkClassName={"page-link"}
          nextClassName={"page-item"}
          nextLinkClassName={"page-link"}
          breakClassName={"page-item"}
          breakLinkClassName={"page-link"}
          activeClassName={"active"}
        />
        <div style={{ paddingTop: 50 }}>
          <Footer />
        </div>
      </div>
    </div>
  );
}
